/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
    console.log(props);
  }

  render() {
    return (
      <div>
        <ul>
          <li>{this.props.original_title}</li>
          <li>{this.props.overview}</li>
          <li>{this.propspopularity}</li>
        </ul>
      </div>
    );
  }
}

export default MovieList;
